import {
  faFacebook,
  faGithubAlt,
  faGoogle,
  faTwitter,
} from '@fortawesome/free-brands-svg-icons';

import { Estilos } from '../styles/estilosFooter';
import { faImages } from '@fortawesome/pro-solid-svg-icons';
import { faUserGraduate } from '@fortawesome/pro-light-svg-icons';
import { library } from '@fortawesome/fontawesome-svg-core';

library.add(
  faUserGraduate,
  faImages,
  faGithubAlt,
  faGoogle,
  faFacebook,
  faTwitter
);

export default class extends React.Component {
  render() {
    return (
      <Estilos className="footer">
        <div className="logo">DIGEVO</div>
        <div className="principal">
          <br />
          <br />
          <br />
          <div className="info">Oficina central - Santiago de Chile </div>
          <a className="contacto" href="https://digevo.com/contacto/">
            contacto@digevo.com
          </a>
          <div className="info">Empresa 3G Motion SpA </div>
        </div>
        <div className="secundario">
          <div className="info">Â© Copyright Digevo 2020 </div>
          <div>
            facebook
            <FontAwesomeIcon
              icon={['fal', 'home']}
              transform="down-4 grow-2.5"
            />
          </div>
          <FontAwesomeIcon icon={['fab', 'facebook']} />
        </div>
      </Estilos>
    );
  }
}
